import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ObjekteComponent } from './objekte/objekte.component';
import { FormsModule } from '@angular/forms';
import { CreateObjektComponent } from './create-objekt/create-objekt.component';
import { HttpClientModule } from '@angular/common/http';
import { JsonDataComponent } from './json-data/json-data.component';
//import { HttpClientInMemoryWebApiModule } from 'angular-in-memory-web-api';
//import { InMemoryDataService } from './in-memory-data.service';

@NgModule({
  declarations: [
    AppComponent,
    ObjekteComponent,
    CreateObjektComponent,
    JsonDataComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule,

    //HttpClientInMemoryWebApiModule.forRoot(InMemoryDataService)
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
